import React from 'react';
import InputMask from 'react-input-mask';

const ColaboradorForm = ({ formData, onChange, onSubmit }) => {
  return (
    <form onSubmit={onSubmit} className="mb-3">
      <div className="row">
        <div className="col">
          <input className="form-control" placeholder="Nome completo" name="nome" value={formData.nome} onChange={onChange} />
        </div>
        <div className="col">
          <InputMask className="form-control" placeholder="CPF" name="cpf" mask="999.999.999-99" value={formData.cpf} onChange={onChange} />
        </div>
      </div>
      <div className="row mt-2">
        <div className="col">
          <input className="form-control" placeholder="E-mail" name="email" value={formData.email} onChange={onChange} />
        </div>
        <div className="col">
          <input className="form-control" placeholder="Cargo" name="cargo" value={formData.cargo} onChange={onChange} />
        </div>
        <div className="col">
          <InputMask className="form-control" placeholder="Telefone" name="telefone" mask="(99) 99999-9999" value={formData.telefone} onChange={onChange} />
        </div>
      </div>
      <button className="btn btn-success mt-3" type="submit">Salvar</button>
    </form>
  );
};

export default ColaboradorForm;
